็ดที่นำเข้าจากต่างประเทศ และมีงานวิจัยรองรับในต่างประเทศ พบว่า เมื่อให้ผู้สูงวัยทานเห็ดชนิดนี้ สามารถช่วยลดความถี่ของการเป็นหวัดธรรมดาลงได้ (ไม่ใช่ไข้หวัดใหญ่ หรือโควิด)\n3. \"เห็ดหอม\" มีงานวิจัยจากประเทศจีนรองรับเยอะ ว่าสามารถเพิ่มภูมิคุ้มกันให้แก่ร่างกายได้\n\n*** คำเตือน : เห็ดส่วนใหญ่มีสารเบต้ากลูแคนส์ก็จริง แต่ให้ระวังเห็ดบางชนิดที่ไม่เคยรู้จัก ไม่เคยถูกนำมาเป็นอาหารหรือยามาก่อน ไม่แนะนำให้รับประทาน ***\n\n\n#CoronaVirusFacts #COVID19 #ชัวร์ก่อนแชร์ #stayhome #withme\n-----------------------------------------------------\n\nพบกันทุกวันใน ข่าวค่ำ ช่อง 9 MCOT HD \n\n✮ หากได้รับอะไรมา อย่าเพิ่งแชร์ต่อ ส่งมาตรวจสอบกับ \"ศูนย์ชัวร์ก่อนแชร์\" ✮\n► แอดไลน์ (LINE) : @TNAMCOT หรือคลิก http://line.me/ti/p/%40tnamcot \n► เฟซบุ๊ก : https://www.facebook.com/SureAndShare\n► ทวิตเตอร์ : https://www.twitter.com/SureAndShare\n► อินสตาแกรม : https://instagram.com/SureAndShare\n► เว็บไซต์ : https://www.ชัวร์ก่อนแชร์.com","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/cOHTk6nTy8k/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLD7I-CAU-iey1YA4YirD8cT_K4Exg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/cOHTk6nTy8k/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAfyt1MLQL1YntSEbCMmWqpGdCoNA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/cOHTk6nTy8k/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAFfTJwxRZtxRLYtbYjxQDPDHdwoA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/cOHTk6nTy8k/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBSzGQiVZtTGxwYwKs-IFrHwoyT4Q","width":336,"height":188},{"url":"https://i.ytimg.com/vi/cOHTk6nTy8k/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"3459","author":"ชัวร์ก่อนแชร์ Sure And Share","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedR ี่ของการเป็นหวัดธรรมดาลงได้ (ไม่ใช่ไข้หวัดใหญ่ หรือโควิด)\n3. \"เห็ดหอม\" มีงานวิจัยจากประเทศจีนรองรับเยอะ ว่าสามารถเพิ่มภูมิคุ้มกันให้แก่ร่างกายได้\n\n*** คำเตือน : เห็ดส่วนใหญ่มีสารเบต้ากลูแคนส์ก็จริง แต่ให้ระวังเห็ดบางชนิดที่ไม่เคยรู้จัก ไม่เคยถูกนำมาเป็นอาหารหรือยามาก่อน ไม่แนะนำให้รับประทาน ***\n\n\n#CoronaVirusFacts #COVID19 #ชัวร์ก่อนแชร์ #stayhome #withme\n-----------------------------------------------------\n\nพบกันทุกวันใน ข่าวค่ำ ช่อง 9 MCOT HD \n\n✮ หากได้รับอะไรมา อย่าเพิ่งแชร์ต่อ ส่งมาตรวจสอบกับ \"ศูนย์ชัวร์ก่อนแชร์\" ✮\n► แอดไลน์ (LINE) : @TNAMCOT หรือคลิก http://line.me/ti/p/%40tnamcot \n► เฟซบุ๊ก : https://www.facebook.com/SureAndShare\n► ทวิตเตอร์ : https://www.twitter.com/SureAndShare\n► อินสตาแกรม : https://instagram.com/SureAndShare\n► เว็บไซต์ : https://www.ชัวร์ก่อนแชร์.com"},"lengthSeconds":"209","ownerProfileUrl":"http://www.youtube.com/channel/UC5Bd7izFr5x3jNL0peJpmaA","externalChannelId":"UC5Bd7izFr5x3jNL0peJpmaA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","S ออนไลน์มีหลายข้อสงสัยเกี่ยวกับคำแนะนำที่บอกว่า การรับประทานเห็ดจะช่วยเพิ่มภูมิต้านทานให้กับร่างกายในช่วงระบาดโควิด-19 จริงหรือ ?\n\nร่วมตรวจสอบข้อเท็จจริงไปกับคุณพีรพล อนุตรโสตถิ์ จากศูนย์ชัวร์ก่อนแชร์ และ รศ.ดร.ภญ.นพมาศ สุนทรเจริญนนท์ ที่ปรึกษาสำนักงานข้อมูลสมุนไพร คณะเภสัชศาสตร์ มหาวิทยาลัยมหิดล\n\nตรวจสอบความจริง โดย พงศ์อิทธิ์ เชิดชูวงศ์\n\nสรุป : ✅ ชัวร์ แชร์ได้ ✅\n\nเห็ดสามารถทานเป็นอาหารหรือทานเป็นยาก็ได้ \nแต่ที่อยากแนะนำคือ ควรอยู่บ้าน และสามารถรับประทานเห็ดได้ทุกชนิด เห็ดอะไรก็ได้ ซึ่งสารที่สำคัญที่สุดที่จะได้จากการทานเห็ด คือ \"เบต้ากลูแคนส์\" (Beta-Glucans) ซึ่งจะได้จากการต้มเห็ด โดยสารชนิดนี้จะช่วยเพิ่มภูมิคุ้มกันให้แก่ร่างกาย\n\n1. \"เห็ดสกุลนางรม\" ได้แก่ เห็ดนางฟ้า เห็ดภูฏาน เห็ดออรินจิ เห็ดนางรม มีงานวิจัยรองรับว่ามีสารเบต้ากลูแคนส์ \n2. \"เห็ดแชมปิญอง\" เป็นเห็ดที่นำเข้าจากต่างประเทศ และมีงานวิจัยรองรับในต่างประเทศ พบว่า เมื่อให้ผู้สูงวัยทานเห็ดชนิดนี้ สามารถช่วยลดความถี่ของการเป็นหวัดธรรมดาลงได้ (ไม่ใช่ไข้หวัดใหญ่ หรือโควิด)\n3. \"เห็ดหอม\" มีงานวิจัยจากประเทศจีนรองรับเยอะ ว่าสามารถเพิ่มภูมิคุ้มกันให้แก่ร่างกายได้\n\n*** คำเตือน : เห็ดส่วนใหญ่มีสารเบต้ากลูแคนส์ก็จริง แต่ให้ระวังเห็ดบางชนิดที่ไม่เคยรู้จัก ไม่เคยถูกนำมาเป็นอาหารหรือยามาก่อน ไม่แนะนำให้รับประทาน ***\n\n\n"},{"text":"#CoronaVirusFacts","navigationEndpoint":{"clickTrackingParams":"CJsDENzXBBgDIhMIvYHE0q66-AIViN1VCh0lOQny","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/coronavirusfacts","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUSChBjb3JvbmF2aXJ1c2ZhY3Rz"}},"loggingDirectives":{"trackingParams":"CJsDENzXBBgDIhMIvYHE0q66-AIViN1VCh0lOQny","visibility":{"types":"12"}}},{"text":" "},{"text":"#COVID19","navigationEndpoint":{"clickTrackingParams":"CJoDENzXBBgFIhMIvYHE0q66-AIViN1VCh0lOQny","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/covid19","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gU MENT_PANEL_VISIBILITY_HIDDEN","loggingDirectives":{"trackingParams":"CCsQ040EGAEiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","visibility":{"types":"12"}}}},{"engagementPanelSectionListRenderer":{"panelIdentifier":"engagement-panel-structured-description","header":{"engagementPanelTitleHeaderRenderer":{"title":{"simpleText":"Beschrijving"},"visibilityButton":{"buttonRenderer":{"icon":{"iconType":"CLOSE"},"trackingParams":"CCoQ8FsiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","accessibilityData":{"accessibilityData":{"label":"Sluiten"}},"command":{"clickTrackingParams":"CCoQ8FsiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CCoQ8FsiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},{"clickTrackingParams":"CCoQ8FsiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","updateToggleButtonStateCommand":{"toggled":false,"buttonId":"TOGGLE_BUTTON_ID_TYPE_STRUCTURED_DESCRIPTION"}}]}}}},"trackingParams":"CCQQ040EGAIiEwi9gcTSrrr4AhWI3VUKHSU5CfI="}},"content":{"structuredDescriptionContentRenderer":{"items":[{"expandableVideoDescriptionBodyRenderer":{"descriptionBodyText":{"runs":[{"text":"...บนสังคมออนไลน์มีหลายข้อสงสัยเกี่ยวกับคำแนะนำที่บอกว่า การรับประทานเห็ดจะช่วยเพิ่มภูมิต้านทานให้กับร่างกายในช่วงระบาดโควิด-19 จริงหรือ ?\n\nร่วมตรวจสอบข้อเท็จจริงไปกับคุณพีรพล อนุตรโสตถิ์ จากศูนย์ชัวร์ก่อนแชร์ และ รศ.ดร.ภญ.นพมาศ สุนทรเจริญนนท์ ที่ปรึกษาสำนักงานข้อมูลสมุนไพร คณะเภสัชศาสตร์ มหาวิทยาลัยมหิดล\n\nตรวจสอบความจริง โดย พงศ์อิทธิ์ เชิดชูวงศ์\n\nสรุป : ✅ ชัวร์ แชร์ได้ ✅\n\nเห็ดสามารถทานเป็นอาหารหรือทานเป็นยาก็ได้ \nแต่ที่อยากแนะนำคือ ควรอยู่บ้าน และสามารถรับประทานเห็ดได้ทุกชนิด เห็ดอะไรก็ได้ ซึ่งสารที่สำคัญที่สุดที่จะได้จากการทานเห็ด คือ \"เบต้ากลูแคนส์\" (Beta-Glucans) ซึ่งจะได้จากการต้มเห็ด โดยสารชนิดนี้จะช่วยเพิ่มภูมิคุ้มกันให้แก่ร่างกาย\n\n1. \"เห็ดสกุลนางรม\" ได้แก่ เห็ดนางฟ้า เห็ดภูฏาน เห็ดออรินจิ เห็ดนางรม มีงานวิจัยรองรับว่ามีสารเบต้ากลูแคนส์ \n2. \"เห็ดแชมปิญอง\" เป็นเห็ดที่นำเข้าจากต่างประเทศ และมีงานวิจัยรองรับในต่างประเทศ พบว่า เมื่อให้ผู้สูงวัยทานเห็ดชนิดนี้ สามารถช่วยลดความถี่ของการเป็นหวัดธรรมดาลงได้ (ไม่ใช่ไข้หวัดใหญ่ หรือโควิด)\n3. \"เห็ดหอม\" มีงานวิจัยจากประเทศจีนรองรับเยอะ ว่าสามารถเพิ่มภูมิคุ้มกันให้แก่ร่างกายได้\n\n*** คำเตือน : เห็ดส่วนใหญ่มีสารเบต้ากลูแคนส์ก็จริง แต่ให้ระวังเห็ดบางชนิดที่ไม่เคยรู้จัก ไม่เคยถูกนำมาเป็นอาหารหรือยามาก่อน ไม่แนะนำให้รับประทาน ***\n\n\n"},{"text":"#CoronaVirusFacts","navigationEndpoint":{"clickTrackingParams":"CCkQ3NcEGAIiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/coronavirusfacts","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUSChBjb3JvbmF2aXJ1c2ZhY3Rz"}},"loggingDirectives":{"trackingParams":"CCkQ3NcEGAIiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","visibility":{"types":"12"}}},{"text":" "},{"text":"#COVID19","navigationEndpoint":{"clickTrackingParams":"CCgQ3NcEGAQiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/covid19","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUJCgdjb3ZpZDE5"}},"loggingDirectives":{"trackingParams":"CCgQ3NcEGAQiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","visibility":{"types":"12"}}},{"text":" "},{"text":"#ชัวร์ก่อนแชร์","navigationEndpoint":{"clickTrackingParams":"CCcQ3NcEGAYiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/%E0%B8%8A%E0%B8%B1%E0%B8%A7%E0%B8%A3%E0%B9%8C%E0%B8%81%E0%B9%88%E0%B8%AD%E0%B8%99%E0%B9%81%E0%B8%8A%E0%B8%A3%E0%B9%8C","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUpCifguIrguLHguKfguKPguYzguIHguYjguK3guJnguYHguIrguKPguYw%3D"}},"loggingDirectives":{"trackingParams":"CCcQ3NcEGAYiEwi9gcTSrrr4AhWI3VUKHSU5CfI=","visibility":{"types":"12"}}},{"text":" "},{"text":"#stayhome","navi
